field\"});\n\nif (typeof(cb_obj.selected) != 'undefined') {\n    var id = data['id'][inds[0]];\n    var allfilters = ['diff','F658N','F625W','F275W','F336W','F475W','F814W','F110W','F160W'];\n    for ( i = 0; i < allfilters.length; i++) {\n        loadNewImage(allfilters[i],id);\n    }\n    // loadNewImage('diff',id);\n    // loadNewImage('F625W',id);\n    // loadNewImage('F658N',id);\n    // JS9.SetPan(regions[0].x, regions[0].y, {display: \"fullfield\"});\n    // JS9.SetZoom(0.5, {display: \"fullfield\"});\n    var filt = filters.data;\n    var mags = [16,28];\n    for (i = 0; i < filt['wav'].length; i++) {\n        var key = filt['keys'][i];\n        var mag = data[key.toLowerCase() + '_vega'][inds[0]];\n        if ((mag < 35) && (mag > 10)) {\n            mags.push(mag);\n        } else {\n            mag = 'nan';\n        }\n        filt['mag'][i] = mag;\n    }\n    filters.trigger('change');\n    var maxmag = Math.max(...mags);\n    var minmag = Math.min(...mags);\n    var yrange = maxmag - minmag;\n    if (minmag != 16) {\n        y_range.end = minmag-0.1*yrange;\n    } else {\n        y_range.end = 16;\n    }\n    if (maxmag != 28) {\n        y_range.start = maxmag+0.15*yrange;\n    } else {\n        y_range.start = 28;\n    }\n} else {\n    JS9.SetZoom('toFit');\n}\n\nreturn false;\n"},"id":"8d55de2f-b9d7-44ff-8ce0-c9142cef9581","type":"CustomJS"},{"attributes":{"plot":{"id":"67a1cb49-117d-4ce5-826e-5a9a63dad36b","subtype":"Figure","type":"Plot"}},"id":"6197efb6-b96d-4bfe-a911-fd5e852f7330","type":"SaveTool"},{"attributes":{},"id":"7a25511c-997e-4e92-896a-705eb6af05e1","type":"ToolEvents"},{"attributes":{"plot":{"id":"cab80a3f-d22c-46be-827e-d91da83131bf","subtype":"Figure","type":"Plot"}},"id":"577edd44-b609-4998-8cc8-c51cf8e23e90","type":"SaveTool"},{"attributes":{"overlay":{"id":"3cc99ff0-d201-4ee5-b995-a7a2bbb992fc","type":"BoxAnnotation"},"plot":{"id":"67a1cb49-117d-4ce5-826e-5a9a63dad36b","subtype":"Figure","type":"Plot"}},"id":"9dc834a3-4621-48c8-817
